	/**
	 * capitalizes the first letter and lower-cases every consecutive letter
	 */
	String capitalise(String s) {
		if (s.length() == 0) {
			return s;
		}

		StringBuffer s1 = new StringBuffer(s);
		if (Character.isLowerCase(s1.charAt(0))) {
			s1.setCharAt(0, Character.toUpperCase(s1.charAt(0)));

		}

		for (int j = 1; j < s1.length(); j++) {
			if (Character.isUpperCase(s1.charAt(j))) {
				s1.setCharAt(j, Character.toLowerCase(s1.charAt(j)));
			}
		}

		return s1.toString();

	}

	/**
	 * Loads a list of words from the array and stores them in a HashSet.
	 */
	private static Set<String> loadVerbStemSet(String[] verbStems) {
		HashSet<String> set = new HashSet<String>(verbStems.length);
		for (int i = 0; i < verbStems.length; i++) {
			set.add(verbStems[i]);
		}
		return set;
	}

	/**
	 * lowercase the characters up to the given length
	 */
	void downcase(StringBuffer text, int leng) {
		for (int i = 0; i < leng; i++) {
			if (Character.isUpperCase(text.charAt(i))) {
				text.setCharAt(i, Character.toLowerCase(text.charAt(i)));
			}
		}
	}

	String condub_stem(int del, String add, String affix) {

		int stem_length = yylength() - del;
		char d;
		yytextBuff = new StringBuffer(yytext());

		if (Option(change_case)) {
			downcase(yytextBuff, stem_length);
		}

		d = yytextBuff.charAt(stem_length - 1);
		if (del > 0) {
			yytextBuff.setLength(stem_length - 1);
		}

		if (!verbStemSet.contains(yytextBuff.toString())) {
			yytextBuff.append(d);
		}

		if (Option(print_affixes)) {
			yytextBuff.append('+');
			yytextBuff.append(affix);
		}

		return yytextBuff.toString();
	}

